	add("turbine", "{\"term\":\"turbine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027turbine\u0027 from Latin \u0027lang\u003dla|turbo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various rotary machines that use the kinetic energy of a continuous stream of fluid (a liquid or a gas) to turn a shaft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/4/the-adaptable-gas-turbine The Adaptable Gas passage\u003d\u0027\u0027Turbines\u0027\u0027 have been around for a long time‚Äîwindmills and water wheels are early examples. The name comes from the Latin \u0027turbo\u0027, meaning vortex, and thus the defining property of a \u0027\u0027turbine\u0027\u0027 is that a fluid or gas turns the blades of a rotor, which is attached to a shaft that can perform useful work\", \"priority\":2}]}, \"synonyms\":{}}");

