	add("turin", "{\"term\":\"turin\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\"], \"text\":\"Ultimately from the name of the w:Taurini|Taurini tribe. The name is probably from Proto-celtic {{m|cel-pro|*tur||water}} or {{m|cel-pro|*tauro||mountain}}. Connections to Latin \u0027taurus\u0027 (bull) are folk etymology.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Province of Piedmont, Italy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Capital city of the province of Turin\", \"priority\":2}]}, \"synonyms\":{}}");

