	add("turkey", "{\"term\":\"turkey\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027turkey\u0027 The guinea fowl (\u0027numida meleagris\u0027 , native to Africa, was imported to Europe by \u0027Turkey merchants\u0027. The larger northern American bird \u0027meleagris gallopavo\u0027 thought to resemble the guinea fowl, was brought to Spain by conquistadors in 1523; from there it was introduced to northern Africa, at the time under Ottoman rule, and then via the Middle East back into Europe.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Roasted turkey at Loola\u0027s by Awfully Chocolate, Esplanade ‚Äì Theatres on the Bay, Singapore - thumb|A roasted turkey at a restaurant in . Roasted turkey is traditionally served to celebrate Thanksgiving Day and Christmas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Either of two species of bird in the genus \u0027Meleagris\u0027 with fan-shaped tails and wattled necks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The guinea fowl (\u0027Numida meleagris\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A failure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That film was a \u0027\u0027turkey\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A foolish or inept person\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027turkey\u0027\u0027 cut in front of me and then berated me for running into him\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An act of throwing three strikes in a row\", \"priority\":8}]}, \"synonyms\":{}}");

	add("turkey", "{\"term\":\"turkey\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"French\", \"old turkish\", \"pahlavi\"], \"text\":\"From French \u0027turquie\u0027 \u0027turcia\u0027 from \u0027turcus\u0027 (turk) from \u0027œÑŒø·ø¶œÅŒ∫ŒøœÇ\u0027 from Persian \u0027ÿ™ÿ±⁄©\u0027 from Pahlavi \u0027twlk\u0027\u0027 from an Old turkish autonym, \u0027T√ºrk\u0027 or \u0027T√ºr√ºk\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Country at the intersection of Europe and Asia on the Mediterranean. Official name: Republic of Turkey\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turkic", "{\"term\":\"turkic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Turk|ic|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The language family that includes Turkish, Tatar, Bashkir, Kazakh, Uzbek, Azeri, Kyrgyz, Uyghur, Tuvan, Altai, Shor, Karakalpak, Khakas, Chuvash, Yakut, and any of the other dozens of languages spoken by Turkic peoples. It may be a subfamily of an Altaic language family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turkish", "{\"term\":\"turkish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Turk|ish|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The official language of Turkey and Turkish Republic of Northern Cyprus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turkishness", "{\"term\":\"turkishness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Turkish|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being Turkish\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Mae Henderson, \u0027Borders, boundaries, and frames\u0027 (page 137\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In written sources, the notion of ethnic \u0027\u0027Turkishness\u0027\u0027 originated with European enthusiasts in the mid-nineteenth century\", \"priority\":3}]}, \"synonyms\":{}}");

	add("turkmen", "{\"term\":\"turkmen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Turkmenistan or of Turkmen descent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Chahryar Adle, \u0027History of Civilizations of Central Asia\u0027 (page 316\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The conquest took 16 years and ended in 1885 in a battle with the Afghans on the banks of the Murghab. During this period, the \u0027\u0027Turkmens\u0027\u0027 offered the Russians stubborn resistance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Barbara A. West, \u0027Encyclopedia of the Peoples of Asia and Oceania\u0027 (page 841\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Keimir-Ker, a \u0027\u0027Turkmen\u0027\u0027 from the Tekke clan, led a rebellion against the Persians\", \"priority\":5}]}, \"synonyms\":{}}");

	add("turkmenistan", "{\"term\":\"turkmenistan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Turkmen\"], \"text\":\"From Turkmen \u0027t√ºrkmenistan\u0027 from \u0027t√ºrkmen\u0027 (turk-like; turkmen) + Persian \u0027ŸÄÿ≥ÿ™ÿßŸÜ\u0027 (tr\u003d-estƒÅn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Country in Central Asia. Official name: Turkmenistan\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turlough", "{\"term\":\"turlough\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Irish\"], \"text\":\"From Irish \u0027tur\u0027 (dry) + \u0027loch\u0027 (lake)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A temporary lake in an area of limestone, filled by rising groundwater during the rainy winter season\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, David Riley, \u0027A Celtic Tale\u0027, page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Naisi said that it was a \u0027\u0027turlough\u0027\u0027, or a disappearing lake, and that before the year\u0027s end, it would be full of water again\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Dermot Bolger, \u0027The Journey Home\u0027, page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"How deep was that small lake‚Äîmore a \u0027\u0027turlough\u0027\u0027 really, filled with water in autumn and winter, a dry hollow in summer\", \"priority\":5}]}, \"synonyms\":{}}");

	add("turmoil", "{\"term\":\"turmoil\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"{{unk.|en}} origin. Perhaps from Old french (842-ca. 1400) \u0027lang\u003dfro|tremouille\u0027 () \u0026lt;!-- Webster 1913, Century 1911; also OEtD, which speaks of M.Fr. tremouille. --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of great disorder or uncertainty\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Harassing labour; trouble; disturbance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And there I\u0027ll rest, as after much \u0027\u0027turmoil\u0027\u0027, / A blessed soul doth in Elysium\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThe \u0027\u0027turmoil\u0027\u0027 went on\u0026amp;mdash;no rest, no peace. [‚Ä¶] It was nearly eleven o\u0027clock now, and he strolled out again. In the little fair created by the costers\u0027 barrows the evening only seemed beginning; and the naphtha flares made one\u0027s eyes ache, the men\u0027s voices grated harshly, and the girls\u0027 faces saddened one\", \"priority\":5}]}, \"synonyms\":{}}");

	add("turnbuckle", "{\"term\":\"turnbuckle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Image:Turnbuckle.jpg|thumb|right|A turnbuckle.From turn + buckle\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coupling device consisting of two eyelets or other connection points connected in screw threads. The joint in between can be turned to shorten or lengthen the device with mechanical advantage provided by the screw threads\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A link threaded on both ends of a short bar which is used to pull objects together. (FM 55-501\", \"priority\":2}]}, \"synonyms\":{}}");

	add("turncoat", "{\"term\":\"turncoat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{cleanup}}A compound of {{compound|turn|coat|lang\u003den}}, reportedly derived from the sometime military practice of wearing uniform coats that were lined in material of a contrasting color, and which could be worn inside out to present a different appearance.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traitor; one who turn turns against a previous affiliation or allegiance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turndown", "{\"term\":\"turndown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|turn|down|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A downturn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The service of turning down the bedcovers and often leaving chocolates etc. on the pillow\", \"priority\":2}]}, \"synonyms\":{}}");

	add("turneaureite", "{\"term\":\"turneaureite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brown mineral that is a mixed arsenate, phosphate and chloride of calcium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turning", "{\"term\":\"turning\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|turn|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A turn or deviation from a straight course\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Take the second \u0027\u0027turning\u0027\u0027 on the left\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The shaping of wood or metal on a lathe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of turning\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003dOpening volume\u003d100|issue\u003d2|page\u003d112-3|magazine\u003dw:American American url\u003dhttp://www.americanscientist.org/issues/pub/opening-doors|passage\u003dA doorknob of whatever roundish shape is effectively a continuum of levers, with the axis of the latching mechanism\u0026amp;mdash;known as the spindle\u0026amp;mdash;being the fulcrum about which the \u0027\u0027turning\u0027\u0027 takes place\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shavings produced by turning something on a lathe\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027turnings\u0027\u0027 get into your trouser turnups\", \"priority\":7}]}, \"synonyms\":{}}");

	add("turnip", "{\"term\":\"turnip\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"From \u0027\u0027 probably from \u0027\u0027 (due to round shape, as though turned on a lathe) + Middle english (1100-1500) \u0027nepe\u0027 from Old english (ca. 450-1100) \u0027n√¶p\u0027 from Latin \u0027napus\u0027 \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; Cognate to \u0027\u0027 see also \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The white root of a yellow-flowered plant, \u0027Brassica rapa\u0027, grown as a vegetable and as fodder for cattle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The yellow root of a related plant, the swede or \u0027Brassica napus\", \"priority\":2}]}, \"synonyms\":{}}");

	add("turnover", "{\"term\":\"turnover\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or result of overturning something; an upset\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a bad \u0027\u0027turnover\u0027\u0027 in a carriage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The amount of money taken as sales transacted in a calendar yea\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The company had an annual \u0027\u0027turnover\u0027\u0027 of $500,000\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The number of times that stock is replaced after being used or sold, a worker is replaced after leaving, or a property changes hand\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Those apartments have a high \u0027\u0027turnover\u0027\u0027 because they are so close to the railroad tracks\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"High staff-turnover can lead to low morale amongst employees\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A semicircular pastry made by turning one half of a circular crust over the other, enclosing the filling (usually fruit\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"They only served me one apple \u0027\u0027turnover\u0027\u0027 for breakfast\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A loss of possession of the ball without scoring\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The Nimrods committed another dismaying \u0027\u0027turnover\u0027\u0027 en route to another humiliating loss\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An apprentice, in any trade, who is handed over from one master to another to complete his time\", \"priority\":12}]}, \"synonyms\":{}}");

	add("turnstile", "{\"term\":\"turnstile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"turn (rotating) + stile (gate)Image:Turnstile.alewife.agr.jpg|A set of turnstiles in the USA|right|thumb|190px\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rotating mechanical device that controls and counts passage between public areas, especially one that only allows passage after a charge has been made\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0026lt;math\u0026gt; vdash\u0026lt;/math\u0026gt; symbol used to represent (deducibility relation), especially of the syntactic type, i.e., syntactic consequence. (Such symbol can be read as \u0026quot;proves\u0026quot;.\u0026lt;ref\u0026gt;http://www.uky.edu/~look/Phi520-Lecture4.pdf\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Comma-separated elements preceding the turnstile should be interpreted as forming a conjunction, whereas comma-separated elements following the turnstile should be interpreted as forming a disjunction\", \"priority\":3}]}, \"synonyms\":{}}");

	add("turnstone", "{\"term\":\"turnstone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|turn|stone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of two species of coastal wading bird, \u0027Arenaria interpres\u0027 and \u0027Arenaria melanocephala\u0027, that breed in the Arctic and readily turn stones or seaweed looking for hidden invertebrates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turntable", "{\"term\":\"turntable\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|turn|table|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The circular rotating platform of a record player or DJ console on which the record rests during play\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A similar device to be connected to the amplifier of a hi-fi system\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A circular rotating platform used for turning locomotives, cars or trucks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A rotating platform designed for use by a car, either motorized or manually rotated, and usually installed in a driveway or in a garage floor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A circular rotating platform for cakes, called a cake turntable\u0026lt;ref\u0026gt;[http://www.wilton.com/store/site/product.cfm?sku\u003d307-303 Cake turntable]\u0026lt;/ref\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

	add("turntablist", "{\"term\":\"turntablist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|turntable|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A DJ who uses a combination of turntables as a musical instrument\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turps", "{\"term\":\"turps\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortened from \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Turpentine or turpentine substitute\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any alcoholic drink\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Paul Smitz, \u0027Australia \u0026amp; New Zealand on a Shoestring\u0027, [http://books.google.com.au/books?id\u003d6oV6VfIH4qYC\u0026amp;pg\u003dPA72\u0026amp;dq\u003d%22turps%22+drink\u0026amp;hl\u003den\u0026amp;ei\u003dBemXTbitKoamcNHUzZYL\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d37\u0026amp;ved\u003d0CNUBEOgBMC\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22turps%22%20drink\u0026amp;f\u003dfalse page 72\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Generally, big nights on the \u0027\u0027turps\u0027\u0027 take place in The Rocks and around Kings Cross ‚Äî where you\u0027ll hear and smell the action pretty quickly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Gregor Paul, \u0027Hard Men Fight Back: Kiwi Sportsmen Who Beat the Odds to Live Their Dream\u0027, [http://books.google.com.au/books?id\u003dEcmjHvEk65QC\u0026amp;pg\u003dPA199\u0026amp;dq\u003d%22turps%22+drink\u0026amp;hl\u003den\u0026amp;ei\u003dBemXTbitKoamcNHUzZYL\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d46\u0026amp;ved\u003d0CP4BEOgBMC\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22turps%22%20drink\u0026amp;f\u003dfalse page 199\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Crazy sessions on the \u0027\u0027turps\u0027\u0027 were all part of the culture\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Alex Bartoli, \u0027Rachel: A Story of Obsessive Love : A Novel\u0027, [http://books.google.com.au/books?id\u003dk23lV3dEO3oC\u0026amp;pg\u003dPA110\u0026amp;dq\u003d%22turps%22+drink\u0026amp;hl\u003den\u0026amp;ei\u003dBemXTbitKoamcNHUzZYL\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d14\u0026amp;ved\u003d0CG4Q6AEwD\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22turps%22%20drink\u0026amp;f\u003dfalse page 110\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"She caught my eye, and called out, ‚ÄúJust showing off the studio. Keep the \u0027\u0027turps\u0027\u0027 flowing.‚Äù\", \"priority\":11}]}, \"synonyms\":{}}");

	add("turpentine", "{\"term\":\"turpentine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle english (1100-1500) \u0027turbentine\u0027 () from Old french (842-ca. 1400) \u0027terbentine\u0027 ultimately from Ancient greek (to 1453) \u0027œÑŒµœÅŒ≠Œ≤ŒπŒΩŒ∏ŒøœÇ\u0027 (terebinth tree)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a volatile essential oil obtained from the wood of pine trees by steam distillation; it is a complex mixture of monoterpenes; it is used as a solvent and paint thinner\", \"priority\":1}]}, \"synonyms\":{}}");

	add("turquoise", "{\"term\":\"turquoise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027turquoise\u0027 from Old french (842-ca. 1400) \u0027\u0027 ((pierre) turqueise) The stone was originally brought to Europe from {{w|Turkestan}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sky-blue, greenish-blue, or greenish-gray semi-precious gemstone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dAlthough there are dozens of different types of gems, among the best known and most important are\u0026amp;nbsp;[\u0026amp;hellip;]\u0026amp;thinsp;. (Common gem materials not addressed in this article include amber, amethyst, chalcedony, garnet, lazurite, malachite, opals, peridot, rhodonite, spinel, tourmaline, \u0027\u0027turquoise\u0027\u0027 and zircon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A pale greenish-blue colour, like that of the gemstone\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe half-dozen pieces [‚Ä¶] were painted white and carved with festoons of flowers, birds and cupids. To display them the walls had been tinted a vivid blue which had now faded, but the carpet, which had evidently been stored and recently relaid, retained its original \u0027\u0027turquoise\", \"priority\":4}]}, \"synonyms\":{}}");

	add("turtleback", "{\"term\":\"turtleback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|turtle|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything having the shape of a turtle\u0027s back (that is, its shell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Winter of the World\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Up he went on concrete stairs that were eroded to \u0027\u0027turtlebacks\u0027\u0027 and slippery with evening\u0027s frost\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A convex deck at the bow or stern of a vessel, designed to shed seawater quickly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A primitive stone celt of a form suggesting the back of a turtle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A library binding of a mass market paperback with a generic hardcover\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, \u0027The Georgia Librarian\u0027 (volumes 32-34\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"When you order Turtleback Books from Baker \u0026amp; Taylor, you can be assured you get \u0027\u0027Turtlebacks\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any plant of the genus \u0027Psathyrotes\u0027 of annual and perennial forbs and low subshrubs native to dry areas of southwestern North America\", \"priority\":9}]}, \"synonyms\":{}}");

	add("turtledom", "{\"term\":\"turtledom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|turtle|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a turtle, or of belonging to the world of turtles; turtles, collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027, w:Henry David Henry David Thoreau, \u0026quot;A Newly Hatched Turtle\u0026quot;, in Bradford Torrey, ed, \u0027The Writings of Henry David Thoreau: Journal\u0027 (1906), page 33\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It does not so much impress me as an infantile beginning of life as an epitome of all the past of \u0027\u0027turtledom\u0027\u0027 and of the earth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Richard D. Bartlett, Patricia Pope Bartlett, \u0027Turtles and Tortoises: Everything About Selection, Care, Nutrition, Breeding, and Behavior\u0027, page 73\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But for a display of agility almost unparalleled in \u0027\u0027turtledom\u0027\u0027, put a small mouse in this turtle\u0027s pen, then stand back and watch\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Mary Blocksma, \u0027Great Lakes Nature: An Outdoor Year\u0027, page 108\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Kids, collectors and the pet store business are threatening \u0027\u0027turtledom\", \"priority\":7}]}, \"synonyms\":{}}");

